The code itself didn't throw an exception, but something was marked to be a problem.

Now the code was removed. This means that the temporary project isn't removed form workspace, but probably it isn't a problem.

I meant:

1. Forward class declarations, for example
class MyClass;
struct MyStruct;

2. Forward method declaration, i.e. function declarations without bodies outside of classes. For example:
int MyFunc(int x, double y);

Method declarations can be subdivided by linkage. It may be beneficial to hide forward declarations only for functions declared static and the ones inside an anonymous namespace.

3. extern declarations of variables can be either treated separately or grouped
together with extern declarations of methods.

