Ed thinks "It sounds like a bug". (http://www.eclipse.org/newsportal/article.php?id=21272&group=eclipse.tools.emf#21272)

When deserializing XML content, document-level comments appearing before the root element get replaced by comments appearing after the root element. Consider the following document:

<!-- start -->
<root/>
<!-- finish -->

We don't have a model or schema for the content, so we'll load it using the following sequence:

XMLProcessor processor = new XMLProcessor();
HashMap options = new HashMap();
XMLOptions xmlOptions = new XMLOptionsImpl();
xmlOptions.setProcessAnyXML(true);
options.put(XMLResource.OPTION_XML_OPTIONS, xmlOptions);
options.put(XMLResource.OPTION_USE_LEXICAL_HANDLER, Boolean.TRUE);

Resource res = processor.load(input, options);

What I'd expect to see is a single object in the resource's contents of type XMLTypeDocumentRootImpl whose mixed feature map contains three entries -- the first comment, then the root element (AnyType), then the other comment.

However, that is not the case. The document root's mixed feature map contains only two entries -- the last comment and the root element, as if the document looked like this:

<!-- finish -->
<root/>

It appears that when the first comment is encountered, FeatureMapUtil.isMany(EObject, EStructuralFeature) returns true -- it doesn't find the feature in the owner's EClass (because at that point the owner is AnyType). However, when the last comment is encountered, the owner is a demand-created DocumentRoot class whose super-type is XMLTypeDocumentRoot. In this case, the isMany method does find the feature in the owner's class and returns false, which causes the first comment to be replaced with the last one.

It appears that switching the if statements in FeatureMapUtil's isMany(EObject, EStructuralFeature) method might do the trick:

...
    if (upperBound == ETypedElement.UNSPECIFIED_MULTIPLICITY)
    {
      EClass eclass = owner.eClass();
      if (feature.getEContainingClass().getEPackage() == XMLTypePackage.eINSTANCE)
      {
        return true;
      }
      else if (eclass.getFeatureID(feature) >= 0)
      {
        return false;
      }
      else
      {
...

