Example code:

public class Main {
    private static Shell shell;

    public static void main(String[] args) {
        Display display = new Display ();
        shell = new Shell(display);
        createContents(shell);
        shell.open ();        
        while (!shell.isDisposed ()) {
            if (!display.readAndDispatch ()) display.sleep ();
        }        
        display.dispose ();
    }

    public static void createContents(final Composite parent)
    {
        parent.setLayout(new GridLayout());

        parent.setBackgroundMode(SWT.INHERIT_FORCE);
        //parent.setBackground(Display.getCurrent().getSystemColor(SWT.COLOR_GREEN));

        final Canvas c = new Canvas(parent,SWT.BORDER);
        c.setLayoutData(new GridData(GridData.FILL_BOTH));
        c.addPaintListener(new PaintListener()
        {        
            public void paintControl(PaintEvent e)
            {
                e.gc.setBackground(e.display.getSystemColor(SWT.COLOR_RED));
                e.gc.fillRectangle(20,20,200,200);

                c.drawBackground(e.gc,40,40,20,20);
            }        
        });        
    }
}

I would expect this code to draw a gray rect at 40,40 but it does not.  If you uncomment the setting of the green background, you will see the green rect show be drawn correctly at 40,40.

